var minimumSum = function(nums) {
    let minSum = Infinity; // Initialize minSum to Infinity to easily find the minimum

    // Iterate through each possible triplet (i, j, k)
    for (let i = 0; i < nums.length - 2; i++) {
        for (let j = i + 1; j < nums.length - 1; j++) {
            for (let k = j + 1; k < nums.length; k++) {
                // Check if current triplet is a mountain
                if (nums[i] < nums[j] && nums[k] < nums[j]) {
                    // Calculate sum of the current triplet
                    const sum = nums[i] + nums[j] + nums[k];
                    // Update minSum if the current sum is less than the minimum found so far
                    minSum = Math.min(minSum, sum);
                }
            }
        }
    }

    // Return minSum if a mountain triplet was found, else return -1
    return minSum === Infinity ? -1 : minSum;
};
